import React from "react";

const SortBar = ({ onSort }) => {
  return (
    <div className="sort-bar" style={{marginBottom: '15px'}}>
      <span className="sort-bar__title">Sort by:</span>
      <button className="sort-bar__btn" onClick={() => onSort("health")}>
        Health
      </button>
      <button className="sort-bar__btn" onClick={() => onSort("damage")}>
        Damage
      </button>
      <button className="sort-bar__btn" onClick={() => onSort("armor")}>
        Armor
      </button>
    </div>
  );
};

export default SortBar;
